import React from 'react';
import './Navbar.css';
import { Link } from 'react-router-dom';

const Navbar = () => {
    return (
        <nav className="navbar">
            <div className="navbar-left">
                <div className="navbar-logo">
                    <h1>LMS</h1>
                    <p>Lawyer Management System</p>
                </div>
                <ul className="navbar-links">
                    <li><Link to="/">Home</Link></li>
                    <li><Link to='../AboutUs.jsx'>About Us</Link></li>
                    <li><Link to="/lawyers">Lawyers / Advocates</Link></li>
                    <li><Link to="/add-lawyer">Add Lawyers / Advocates</Link></li>
                    <li><Link to="/contact">Contact Us</Link></li>
                    <li><Link to="/admin-login">Admin Login</Link></li>
                </ul>
            </div>
            <div className="navbar-right">
                <div className="navbar-search">
                    <input type="text" placeholder="Search" />
                    <button className="search-button">Search</button>
                </div>
                <div className="navbar-contact">
                    <button className="navbar-contact-btn"><a href="/Forgetpassword.jsx">LogIn</a></button>
                </div>
            </div>
        </nav>
    );
};

export default Navbar;
